        @font-face {
            font-family: Roboto, Helvetica, Arial, sans-serit
        }

        .gecko {
            align-items: center;
            color: #fff;
            display: flex;
            flex-direction: column;
            font-family: Roboto;
            font-size: 24px;
            height: 100%;
            justify-content: center;
            margin-top: -40px;
            text-align: center;
            width: 100%
        }

        .gecko-img {
            height: 70%;
            min-width: 400px;
            width: 30%
        }

        .cf-error-details {
            background: #000;
            bottom: 0;
            color: #fff;
            font-family: monospace;
            font-size: 12px;
            padding: 2px 8px;
            position: absolute;
            width: 100%
        }

        .cf-error-details>h1,
        p {
            font-weight: 400;
            padding: 0 24px
        }

        .gecko-font-mobile {
            display: none
        }

        .gecko-font-desktop {
            font-size: 36px;
            margin-top: 0
        }

        @media only screen and (max-device-width:1024px) {
            .gecko {
                font-size: 36px;
                justify-content: flex-start
            }

            .gecko>p {
                display: flex;
                padding: 0 10px
            }

            .cf-error-details {
                font-size: 24px;
                padding: 10px
            }

            .gecko-img {
                height: 62%;
                margin-top: 45%;
                width: 100%
            }

            .gecko-font-mobile {
                font-size: 36px;
                margin-top: 0
            }

            .gecko-font-desktop {
                display: none !important
            }
        }
    </style>

</head>
